import { useEffect, useState } from "react";

const darkenHexColor = (hex: string, percentage: number) =>{
    let sanitizedHex = hex.replace('#', '');

    if (sanitizedHex.length === 3) {
        sanitizedHex = sanitizedHex.split('').map(c => c + c).join('');
    }

    const factor = 1 - (percentage / 100);

    const darkenedHex = [0, 2, 4]
        .map(startIndex => {
            const component = parseInt(sanitizedHex.slice(startIndex, startIndex + 2), 16);
            const darkenedComponent = Math.max(0, Math.min(255, Math.floor(component * factor)));
            return darkenedComponent.toString(16).padStart(2, '0');
        })
        .join('');

    return `#${darkenedHex}`;
}

const lightenHexColor = (hex: string, percentage: number) => {
    let sanitizedHex = hex.replace('#', '');

    if (sanitizedHex.length === 3) {
        sanitizedHex = sanitizedHex.split('').map(c => c + c).join('');
    }

    const factor = percentage / 100;

    const lightenedHex = [0, 2, 4]
        .map(startIndex => {
            const component = parseInt(sanitizedHex.slice(startIndex, startIndex + 2), 16);
            const lightenedComponent = Math.max(0, Math.min(255, Math.floor(component + (255 - component) * factor)));
            return lightenedComponent.toString(16).padStart(2, '0');
        })
        .join('');

    return `#${lightenedHex}`;
}

